Bloody Tales of the Tower

History Documentary hosted by Suzannah Lipscomb and Joe Crowley, published by National Geographic in 2012 - English narration


Information
------------------------------

Bloody Tales of the Tower
The terrible cries of tortured traitors have given the Tower of London a particularly grisly place in the history of the capital of England. Brave a trip to the Tower with investigator Joe Crowley and Tudor historian Dr Suzannah Lipscomb, as this gruesome series explores its infamous blood-spattered past.



2)  Executions 
Despite its reputation as the home of expert execution, accounts of the time suggest that being put to death in the Tower could be a messy business. Was it a faulty axe or executioner's anxiety which caused the botched beheading of the Duke of Monmouth, who finally lost his head at the fifth blow?!



